import {HeaderIcons , HeaderLogo , HeaderNav , HeaderProfile } from '../index'

export default function Header(props){
    return(
    <header className="header">
        <section className="flex">
            <HeaderLogo />
            <HeaderNav />
            <HeaderIcons />
            <HeaderProfile />
        </section>
    </header>
    )
}
